import React, { Component } from "react";
import {
  Button,
  Container,
  AppBar,
  Toolbar,
  Input,
  CardMedia,
  IconButton
} from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faShoppingBag,
  faHeart,
  faUser
} from "@fortawesome/free-solid-svg-icons";

class Header extends Component {
  state = {
    textInput: ""
  };

  inputHandle = event => {
    if (event.target.value) {
      this.setState({ textInput: event.target.value });
    } else {
      this.setState({ textInput: "" });
    }
  };

  render() {
    return (
      <div>
        <AppBar position="static" color="primary">
          <Toolbar>
            <CardMedia
              style={{ width: 100, height: 35, borderRadius: 10 }}
              image="https://storage.googleapis.com/bit-docs/bit-logo%402x.png"
            />
            <Button onClick={() => {}} style={{ color: "white" }}>
              Home
            </Button>
            <Button style={{ color: "white" }}>Contact</Button>
            <Button style={{ color: "white" }}>About</Button>
            <Button style={{ color: "white" }}>Login</Button>
            <Button style={{ color: "white" }}>Register</Button>
            <Input
              onChange={this.inputHandle}
              placeholder="Search..."
              disableUnderline={true}
              style={{
                height: 40,
                width: 500,
                border: "red",
                color: "gray",
                background: "white",
                paddingRight: 5,
                paddingLeft: 5,
                borderColor: "black",
                borderWidth: 2,
                borderRadius: 15,
                marginLeft: 100
              }}
            />
            <IconButton style={{ marginRight: 50 }}>
              <FontAwesomeIcon style={{ color: "white" }} icon={faUser} />
            </IconButton>
            <IconButton>
              <FontAwesomeIcon style={{ color: "white" }} icon={faHeart} />
            </IconButton>
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faShoppingBag}
              />
            </IconButton>
          </Toolbar>
        </AppBar>
        <Container>
          <Button
            variant="contained"
            color="primary"
            onClick={() => console.log(this.state.textInput)}
          >
            Hello World
          </Button>
          <br />
        </Container>
      </div>
    );
  }
}

export default Header;
